if mibBuilder.loadTexts: ciscoFlashDeviceCard.setStatus('deprecated')
if mibBuilder.loadTexts: ciscoFlashDeviceCard.setDescription('This object will point to an instance of a card entry in the cardTable. The card entry will give details about the card on which the Flash device is actually located. For most systems, this is usually the main processor board. On the AGS+ systems, Flash is located on a separate multibus card such as the MC. This object will therefore be used to essentially index into cardTable to retrieve details about the card such as cardDescr, cardSlotNumber, etc.')
ciscoFlashDeviceProgrammingJumper = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 9, 10, 1, 1, 2, 1, 11), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(1, 2, 3))).clone(namedValues=NamedValues(("installed", 1), ("notInstalled", 2), ("unknown", 3)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: ciscoFlashDeviceProgrammingJumper.setStatus('current')
if mibBuilder.loadTexts: ciscoFlashDeviceProgrammingJumper.setDescription('This object gives the state of a jumper (if present and can be determined) that controls the programming voltage called Vpp to the Flash device. Vpp is required for programming (erasing and writing) Flash. For certain older technology chips it is also required for identifying the chips (which in turn is required to identify which programming algorithms to use; different chips require different algorithms and commands). The purpose of the jumper, on systems where it is available, is to write protect a Flash device. On most of the newer remote access routers, this jumper is unavailable since users are not expected to visit remote sites just to install and remove the jumpers when upgrading software in the Flash device. The unknown(3) value will be returned for such systems and can be interpreted to mean that a programming jumper is not present or not required on those systems. On systems where the programming jumper state can be read back via a hardware register, the installed(1) or notInstalled(2) value will be returned. This object is expected to be used in conjunction with the ciscoFlashPartitionStatus object whenever that object has the readOnly(1) value. In such a case, this object will indicate whether the programming jumper is a possible reason for the readOnly state.')
ciscoFlashDeviceInitTime = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 9, 10, 1, 1, 2, 1, 12), TimeStamp()).setMaxAccess("readonly")
if mibBuilder.loadTexts: ciscoFlashDeviceInitTime.setStatus('current')
if mibBuilder.loadTexts: ciscoFlashDeviceInitTime.setDescription('System time at which device was initialized. For fixed devices, this will be the system time at boot up. For removable devices, it will be the time at which the device was inserted, which may be boot up time, or a later time (if device was inserted later). If a device (fixed or removable) was repartitioned, it will be the time of repartitioning. The purpose of this object is to help a management station determine if a removable device has been changed. The application should retrieve this object prior to any operation and compare with the previously retrieved value. Note that this time will not be real time but a running time maintained by the system. This running time starts from zero when the system boots up. For a removable device that has been removed, this value will be zero.')
ciscoFlashDeviceRemovable = MibTableColumn((1, 3, 6, 1, 4, 1, 9, 9, 10, 1, 1, 2, 1, 13), TruthValue()).setMaxAccess("readonly")
if mibBuilder.loadTexts: ciscoFlashDeviceRemovable.setStatus('current')
if mibBuilder.loadTexts: ciscoFlashDeviceRemovable.setDescription('Whether Flash device is removable. Generally, only PCMCIA Flash cards will be treated as removable. Socketed Flash chips and Flash SIMM modules will not be treated as removable. Simply put, only those Flash devices that can be inserted or removed without opening the hardware casing will be considered removable. Further, removable Flash devices are expected to have the necessary hardware support - 1. on-line removal and insertion 2. interrupt generation on removal or insertion.')
