if mibBuilder.loadTexts: ciscoFlashChipWriteRetries.setStatus('current')
if mibBuilder.loadTexts: ciscoFlashChipWriteRetries.setDescription('This object will provide a cumulative count (since last system boot up or initialization) of the number of write retries that were done in the chip. If no writes have been done to Flash, the count will be zero. Typically, a maximum of 25 retries are done on a single location before flagging a write error. A management station is expected to get this object for each chip in a partition after a write failure in that partition. To keep a track of retries for a given write operation, the management station would have to retrieve the values for the concerned chips before and after any write operation.')
